from typing import List
import re


class WordFilter:
    """
    [What's the Time Complexity of Average Regex algorithms? - Stack Overflow](https://stackoverflow.com/questions/5892115/whats-the-time-complexity-of-average-regex-algorithms)
    """

    def __init__(self, words: List[str]):
        self.word_set = {word: i for i, word in enumerate(words)}

    def f(self, prefix: str, suffix: str) -> int:
        pattern = re.compile(r'^' + prefix + r'\w*' + suffix + r'$')
        candidates = []
        for word, i in self.word_set.items():
            if pattern.search(word):
                candidates.append((i, word))

        # Overlap (wrong)
        # i = 0
        # print(prefix, suffix)
        # while True:
        #     if i >= len(prefix) or i >= len(suffix):
        #         if i >= len(prefix):
        #             if suffix in self.word_set:
        #                 candidates.append((self.word_set[suffix], suffix))
        #         elif i >= len(suffix):
        #             if prefix in self.word_set:
        #                 candidates.append((self.word_set[prefix], prefix))
        #         break
        #     if prefix[len(prefix) - i - 1] != suffix[i]:
        #         break
        #     if prefix[:len(prefix) - i - 1] + suffix in self.word_set:
        #         print(prefix[:len(prefix) - i - 1] + suffix)
        #         candidates.append((self.word_set[prefix[:len(prefix) - i - 1] + suffix], prefix[:len(prefix) - i - 1] + suffix))
        #     i += 1

        i = 1
        while i <= len(prefix) and i <= len(suffix):
            # print(prefix, suffix, prefix[len(prefix) - i:],
            #       suffix[:i], prefix[:len(prefix) - i] + suffix)

            if i == len(prefix):
                if suffix.startswith(prefix) and suffix in self.word_set:
                    candidates.append((self.word_set[suffix], suffix))
                break
            elif i == len(suffix):
                if prefix.endswith(suffix) and prefix in self.word_set:
                    candidates.append((self.word_set[prefix], prefix))
                break

            if prefix[len(prefix) - i:] == suffix[:i]:
                if prefix[:len(prefix) - i] + suffix in self.word_set:
                    candidates.append((self.word_set[prefix[:len(
                        prefix) - i] + suffix], prefix[:len(prefix) - i] + suffix))

            i += 1

        if not candidates:
            return -1

        return max(candidates, key=lambda x: (len(x[1]), x[0]))[0]


